DROP TABLE IF EXISTS tabla_hechos;
DROP TABLE IF EXISTS cliente;
DROP TABLE IF EXISTS tiempo;
DROP TABLE IF EXISTS transaccion;
DROP TABLE IF EXISTS sucursal;
DROP TABLE IF EXISTS producto;
DROP TABLE IF EXISTS categoria;

CREATE TABLE cliente(
   id_cliente 	CHAR(40) PRIMARY KEY NOT NULL,
   cedula 	INT NOT NULL,
   nombre_completo CHAR(50) NOT NULL,
   email 	CHAR(50) NOT NULL,
   telefono	CHAR(50) NOT NULL,
   direccion 	CHAR(50) NOT NULL,
   tipo_cliente CHAR(50) NOT NULL
);
CREATE TABLE tiempo(
   id_tiempo 	CHAR(40) PRIMARY KEY NOT NULL,
   anio 	INT NOT NULL,
   mes_num 	INT NOT NULL,
   mes_nombre 	CHAR(40) NOT NULL,
   dia 		INT NOT NULL
);
CREATE TABLE transaccion(
   id_transaccion 	CHAR(40) PRIMARY KEY NOT NULL,
   descripcion 		CHAR(50) NOT NULL
);
CREATE TABLE sucursal(
   id_sucursal 	CHAR(40) PRIMARY KEY NOT NULL,
   region 		CHAR(50) NOT NULL,
   estado		CHAR(50) NOT NULL,
   nombre 		CHAR(50) NOT NULL
);
CREATE TABLE producto(
   id_producto 	CHAR(40) PRIMARY KEY NOT NULL,
   codigo_producto 	INT NOT NULL,
   nombre 		CHAR(50) NOT NULL,
   peso			REAL NOT NULL,
   precio		REAL NOT NULL
);
CREATE TABLE categoria(
   id_categoria 	CHAR(40) PRIMARY KEY NOT NULL,
   cod_categoria 	INT NOT NULL,
   descripcion 	CHAR(50) NOT NULL
);
CREATE TABLE tabla_hechos(

   id_producto CHAR(40),
   id_sucursal CHAR(40),
   id_categoria CHAR(40),
   id_cliente CHAR(40),
   id_transaccion CHAR(40),
   id_tiempo CHAR(40),
   id_fecha_orden DATE,
   id_fecha_envio DATE,
   id_fecha_facturacion DATE,
   id_fecha_cancelacion DATE,
   monto_total REAL,
   cantidad_productos INT,
   FOREIGN KEY (id_producto) REFERENCES producto(id_producto) on delete cascade,
   FOREIGN KEY (id_categoria) REFERENCES categoria(id_categoria) on delete cascade,
   FOREIGN KEY (id_cliente) REFERENCES cliente(id_cliente) on delete cascade,
   FOREIGN KEY (id_transaccion) REFERENCES transaccion(id_transaccion) on delete cascade,
   FOREIGN KEY (id_sucursal) REFERENCES sucursal(id_sucursal) on delete cascade,
   FOREIGN KEY (id_tiempo) REFERENCES tiempo(id_tiempo) on delete cascade

);
